export type PlatformSVGProps = { name: keyof typeof PlatformsEnum } & SvgProps;
export const PlatformSVG = ({ name, ...props }: PlatformSVGProps) => {
	if (!PlatformSVGS[name as keyof typeof PlatformSVGS]) {
		return null;
	}
	const SVG = PlatformSVGS[name as keyof typeof PlatformSVGS];
	return <SVG {...props} />;
};

export const LanguageIcon = ({
	name,
	size,
	...props
}: { name: keyof typeof LanguageEnum | undefined; size: number } & ImageProps) => {
	if (!name) return null;
	return (
		<Image
			{...props}
			source={LanguageImages[name as keyof typeof LanguageEnum]}
			style={[props.style, { width: size, height: size }]}
		/>
	);
};

export const ListIcon = (props: ListIconProps) => {
	const { colors } = useAppTheme();
	return <List.Icon {...props} color={colors.primary} />;
};

